import React, {useState} from 'react'; 
// import './GamesList.css';


const PGNDialog = ({closePopup}) => {

	const [input, setInput] = useState('');

	return (
		<>
			<h1>Import Game</h1> 
				<div className="inputclass">
					<div className="inputtitle">PGN</div>
					<div className="inputbox"> 
						<textarea 
							placeholder="Enter something" 
							onChange={(e) => setInput(e.target.value)} 
							value={input}
							// value="https://lichess.org/game/export/6dFspuKY" 
							id="inputpgn" /> 
					</div>
				</div>

				<div className="inputclass">
					<div className="inputtitle">Lichess</div>
					<div className="inputbox"> 
						<input
							type="text" 
							placeholder="Enter Game ID "  
							id="inputliches" /> 
					</div>
				</div>


			<span 
				id="popupsubmit" 
				className='pointer' 
				value="submit" 
				onClick={()=>closePopup(document.getElementById('inputpgn').value)}>
				Submit
			</span>
		</>
	);
}

export default PGNDialog;
